import logo from './logo.svg';
import './App.css';
import styled from 'styled-components';

 /*stylesheet*/
const Blog = styled.div`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
`;
const Blog_heading = styled.div`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
`;


function App() {

  return (
    <Blog>
      <Blog_heading>
        <img src={logo} className="App-logo" alt="logo" />
        <Title>
          Edit <code>src/App.js</code> and save to reload.
        </Title>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </Blog_heading>
    </Blog>
  );
}

export default App;
